import React, { useState, useEffect } from "react";
import { io } from "socket.io-client";
import MainDiv from "./components/mainDiv";
import ChatInput from "./components/ChatInput";
import "./index.css";

// Backend server IP address
const socket = io("http://192.168.101.32:4000");

function App() {
  const [messages, setMessages] = useState([]);
  const [username, setUsername] = useState("");
  const [room, setRoom] = useState("");
  const [isJoined, setIsJoined] = useState(false);
  const [generatedRoom, setGeneratedRoom] = useState("");

  useEffect(() => {
    socket.on("receiveMessage", (message) => {
      setMessages((prev) => [...prev, message]); // Adding message to the chat
    });

    socket.on("messageResponse", (message) => {
      setMessages((prev) => [...prev, message]); // Receiving response message
    });

    socket.on("user-joined", (notification) => {
      setMessages((prev) => [...prev, { username: "System", text: notification }]);
    });

    socket.on("user-left", (notification) => {
      setMessages((prev) => [...prev, { username: "System", text: notification }]);
    });

    socket.on("previous-messages", (prevMessages) => {
      setMessages(prevMessages); // Loading previous messages
    });

    socket.on("room-created", (roomID) => {
      setGeneratedRoom(roomID);
      setRoom(roomID);
      setIsJoined(true); // Room created and user joined
    });

    return () => {
      socket.off("receiveMessage");
      socket.off("messageResponse");
      socket.off("user-joined");
      socket.off("user-left");
      socket.off("previous-messages");
      socket.off("room-created");
    };
  }, []);

  const createRoom = () => {
    if (username.trim()) {
      socket.emit("createRoom", username);  // Send username to create room
    }
  };

  const joinRoom = () => {
    if (username.trim() && room.trim()) {
      socket.emit("joinRoom", { roomID: room, username });  // Send roomID and username to join
      setIsJoined(true);  // After joining the room
    } else {
      alert("Please enter both username and room ID.");
    }
  };

  const addMessage = (text) => {
    socket.emit("sendMessage", { roomID: room, username, message: text });  // Send message to backend
  };

  return (
    <div>
      {!isJoined ? (
        <div className="join-container">
          <input
            style={{ height: "30px" }}
            type="text"
            placeholder="Enter your username"
            value={username}
            onChange={(e) => setUsername(e.target.value)}
          />
          <br />
          <br />
          <button
            style={{
              backgroundColor: "lightgreen",
              fontSize: "15px",
              borderRadius: "40px",
            }}
            onClick={createRoom}
          >
            Create Room
          </button>
          <br />
          <br />
          <br />
          <input
            style={{ height: "30px" }}
            type="text"
            placeholder="Enter room ID to join"
            value={room}
            onChange={(e) => setRoom(e.target.value)}
          />
          <br />
          <br />
          <button
            style={{
              backgroundColor: "lightgreen",
              fontSize: "15px",
              borderRadius: "40px",
            }}
            onClick={joinRoom}
          >
            Join Room
          </button>
          {generatedRoom && (
            <p>
              Room ID: <strong>{generatedRoom}</strong>
            </p>
          )}
        </div>
      ) : (
        <>
          <h1 style={{ textAlign: "center" }}>Chatroom: {room || generatedRoom}</h1>
          <div className="chat-container">
            <div className="chat-messages">
              <MainDiv messages={messages} />
            </div>
            <div className="chat-input">
              <ChatInput addMessage={addMessage} />
            </div>
          </div>
        </>
      )}
    </div>
  );
}

export default App;
